import React from "react";

export default function Contact() {
  return (
    <div className="Contact-Page" id="Contact">
      <div className="Contact-Container">
        <div className="Contact"><a href="mailto:JackBPainter@gmail.com"><i className="fa fa-envelope-square"></i> JackBPainter@gmail.com</a></div>
        <br />
        <div className="Contact"><a href="tel:07704706668"><i className="fa fa-phone"></i> 07704 706668</a></div>
        <br />
        <div className="Contact"><a href="https://linkedin.com/in/painterjack/"><i className="fa fa-linkedin"></i> https://www.linkedin.com/in/painterjack/</a></div>
      </div>
    </div>
  );
}
